import React from 'react';

const EmployeePage = () => {
    return (
        <div className="bg-gradient-to-br from-blue-500 via-blue-300 to-blue-100 min-h-screen flex flex-col items-center justify-center text-white">
          <div className="text-6xl font-extrabold mb-8">Welcome to Our Company</div>
          <p className="text-2xl mb-8">Your trusted partner in employee management.</p>
          <button className="bg-yellow-400 hover:bg-yellow-500 text-blue-900 font-semibold py-2 px-4 rounded-lg transition duration-300 transform hover:scale-105">
            Get Started
          </button>
        </div>
      );
    };

export default EmployeePage;
